// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "./FeedBackLib.sol";

contract TechnoLimeStore {

    constructor ()public payable{}

    struct Product {
        uint price;
        uint quantity;
        address[] buyers;
        bool exists; 
    }

    // Using the iterable mapping technique
    string[] public availableProducts;
    // 0(1) lookup time when checking if a product already exists in the store
    mapping(string => Product) public products;

    struct Transaction {
        uint blockNum;
        uint price;
        bool exists; 
    }

    mapping(uint => mapping(address => Transaction)) public transactions;
    mapping(uint =>address[]) public buyers;

    function addNewProduct(string calldata productName, uint _price,uint _quantity) external{
         if (!products[productName].exists){
             Product memory product;
             product.price = _price;
             product.quantity = _quantity;
             product.exists = true;
             products[productName] = product;
             availableProducts.push(productName);
         }else{
            //  Using descriptive custom error name instead of string description - to save a bit of gas;
            //  revert Errors.ProductExists();
            revert("Product already exists");
         }
        
    }

    function updateQuantity(string calldata productName,uint _quantity) external{
        if (products[productName].exists){
            products[productName].quantity += _quantity;
        }else{
            //  Using descriptive custom error name instead of string description - to save a bit of gas;
            revert Errors.ProductNotExistent();
        }
    }

    // Following the Checks-Effects-Interactions Pattern - to prevent from Reentrancy Attack
    function buyProduct (uint ProductId)  external payable { 
        // Using short-circuiting to prevent more gas-costly code from running in case of condition fail
            if(ProductId < availableProducts.length && !transactions[ProductId][msg.sender].exists){
                // Loading state variables to memory ( to modify and access them) and then saving them to storage again - more gas efficient
                Product memory product= products[availableProducts[ProductId]];
                if(msg.value < product.price || product.quantity < 1)
                    // Combined custom error for lower gas consumption
                    revert Errors.LessThanPriceOrOutOfStock();

                Transaction memory newTransaction;
                newTransaction.blockNum = block.number;
                newTransaction.price = product.price;
                newTransaction.exists = true;
                // save to storage
                transactions[ProductId][msg.sender] = newTransaction;

                product.quantity--;
                // save to storage
                products[availableProducts[ProductId]]=product;
                // add buyer
                buyers[ProductId].push(msg.sender);

            }else{
                // Combined custom error for lower gas consumption
                revert Errors.ItemIdWrongOrBoughtAlready();
            }   
            
        }

    
    
}

