pragma solidity ^0.8.0;

contract Errors {

    /// Can't add a product that already exists
    error ProductExists();

    error ProductNotExistent();

    /// Error trown when the productID doesn't exist or it has been bought once already
    error ItemIdWrongOrBoughtAlready();

    /// Error trown when money sent is less than Product price
    error LessThanPriceOrOutOfStock();
}

